import React from 'react'

const Footer = () => {
  return (
    <footer className='mt-auto bottom-0'>
        <div className='bg-gradient-to-t from-[#155e75] w-full md:h-[2rem]] lg:h-[3rem]'></div>
    </footer>
  )
}

export default Footer
